                <div className='video'>
                    <video
                        src="video.mp4"
                        controls
                        muted
                        autoPlay={"autoplay"}
                        preLoad="auto"
                        loop
                    // width="500" height="280"
                    > something</video>
                </div>

            </div>
            <div className='bg'>
                <Memories />
                <div className='schedule' style={{ marginTop: '30px' }}>
                    <h1>Schedule</h1>
                    <Schedule />
                </div>
            </div>
        </div>
    )
}
export default Home
